import './StyledImage.css'

function StyledImage(props) {

    const { children, src, alt, width, height, ...other } = props;

    return (
        <div style={{ height: {height} }}>
            <img src={src} alt={alt} style={{font: 'white'}} className='styled-img' />
        </div>
    );
}

export default StyledImage;
